import Link from 'next/link';
import '../assets/css/Style.css';
import logoImage from '../assets/images/logo.png';

const Layout = (props) => {
	console.warn('props', props);
	return (
		<div>
			<div className="header">
			   <div className="top-header">
			      <div className="pizza-logo">
			         <img className="brand-logo" src={logoImage} alt="pizza store logo" />
			         <span>Pizza Store</span>
			      </div>
	            </div>
	         </div>
			<div className="menu">
				{props.value.categories.map(category => (
					<div key={category.id} className="menu-item" data-label="{category.name}">
						<span>{category.name}</span>
					</div>
		      	))}
			</div>
			{props.children}
		</div>
	);
};

export default Layout;
